Ad Text:
An exciting permanent opportunity is available for an experienced Commercial Analyst to join a market-leading organisation within the infrastructure, utilities & manufacturing space.

Reporting to the Head of Commercial Finance, this role will partner closely with sales, operations and product leaders, providing high-quality financial insight to support strategic decision-making, profitability and sustainable growth.

About the Role

As the Commercial Analyst, you will act as the key finance business partner to the business units, delivering meaningful analysis, forecasting and commercial support across tenders, contracts, capital investment and operational performance.

Key responsibilities include:

Acting as the primary finance partner to operational and sales leaders;
Delivering commercial analysis, modelling and insights to improve profitability and performance;
Supporting tenders, pricing, margin reviews and contract management (including rise & fall calculations);
Preparing CAPEX business cases with detailed financial justification;
Leading budgeting, forecasting and Annual Operating Plan processes;
Monitoring weekly and monthly sales, margins and KPIs, identifying risks and opportunities;
Providing detailed variance analysis and forecast outlooks;
Supporting revenue recognition, accruals and project claims; and
Driving continuous improvement initiatives across reporting, systems and digital solutions (ERP, Power BI).
About You

You are a commercially minded finance professional who thrives in a fast-paced, operationally focused environment and enjoys working closely with the business.

You will bring:

A degree in Finance, Accounting, Economics or Business;
CA or CPA qualification (highly regarded);
7+ years’ experience in commercial analysis, financial analysis or a similar role;
Strong business partnering and stakeholder engagement skills;
Advanced analytical, modelling and forecasting capability;
Excellent communication skills with the ability to translate numbers into insights;
Experience working in project-based, infrastructure, utilities or industrial environments (highly regarded); and
A proactive, solutions-focused mindset aligned to values of integrity, continuous improvement and results delivery.
What’s on Offer

Permanent opportunity with a well-established, industry-leading organisation;
Broad commercial exposure across infrastructure and utility projects;
High level of stakeholder interaction and influence;
A role where your insights will directly impact business performance and strategy; and
Supportive, values-driven culture with a focus on continuous improvement.
If you’re looking for a commercially focused role where you can genuinely partner with the business and influence outcomes, this opportunity is well worth exploring.

